webpackJsonp([1194],{"./node_modules/json-loader/index.js!./.cache/json/articles-javascript-javascript-mathmax.json":function(a,e){a.exports={data:{markdownRemark:{html:'<p>The <code>Math.max()</code> function returns the largest of zero or more numbers.</p>\n<h2>Syntax</h2>\n<pre><code>Math.max(value1, value2, ...)\n</code></pre>\n<h3>Parameters</h3>\n<p><code>value1</code>, <code>value2</code> and other arguments should be numbers. All arguments are optional.</p>\n<p>If no arguments are given, the result is Infinity. If at least one of arguments cannot be converted to a number, the result is NaN.</p>\n<p><a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Math/max">MDN link</a> | <a href="https://msdn.microsoft.com/en-us/LIBRary/dxcwky7y(v=vs.94).aspx">MSDN link</a></p>\n<h2>Examples</h2>\n<pre><code>Math.max();         // Infinity\nMath.max(\'a\');      // NaN\nMath.max(NaN);      // NaN\nMath.max(5);        // 5\nMath.max(10, 20);   //  20\nMath.max(-10, -20); // -10\nMath.max(-10, 20);  //  20\n\nvar x = Math.max(107 - 3,  48 * 90);\ndocument.write(x);\n\n// Output:\n// 4320\n</code></pre>',frontmatter:{title:"javaScript Mathmax",parent:"/home/stuart/guides/src/pages/articles/javascript/javascript-mathmax/index.md absPath of file"}}},pathContext:{slug:"/articles/javascript/javascript-mathmax/"}}}});
